import React from 'react'
import { ProfileService } from '../../../client'
import {Image} from "semantic-ui-react";

export default class MyAvatar extends React.Component {
    state = { loading: true, avatar: '' }

    componentDidMount () {
        this.getAvatar()
        setTimeout(() => this.setState({ loading: false }), 1500)
    }

    getAvatar = (): void => {
        ProfileService.getCurrentUserAvatarApiProfileMeAvatarGet().then((response) => {
            console.log(response)
            this.setState({ avatar: response, loading: false })
        })
    }

    render () {
        return (
            <Image src={`data:image/png;base64, `} alt="avatar" width={256} height={256} fluid />
        )
    }
}